   "source": [
    "# Business Task:\n",
    "#### \"Optimizing supply chain efficiency and profitability through data-driven insights\"\n",
    "\n",
    "Key objectives of this business task could include:\n",
    "\n",
    "1. Cost Reduction: Identify areas where costs (e.g., shipping, manufacturing, defects) can be reduced without sacrificing product quality or customer satisfaction. This includes exploring the relationships between shipping costs, transportation modes, and revenue to determine the most cost-effective strategies.\n",
    "\n",
    "2. Stock and Lead Time Optimization: Improve stock levels and order quantities by analyzing the relationship between lead times, stock levels, and sales. The goal is to minimize stockouts and overstock situations, optimizing inventory management while meeting customer demand efficiently.\n",
    "\n",
    "3. Supply Chain Risk Management: Understand how factors like defect rates, transportation routes, and shipping delays impact the overall supply chain and revenue. Identifying these risks allows businesses to improve supplier relationships, adjust production volumes, or select better transportation options to minimize disruptions.\n"
   ]
  },
