   "source": [
    "#Analyzing Shipping Carriers \n",
    "#Shipping costs by carrier\n",
    "library(dplyr)\n",
    "\n",
    "# Load data\n",
    "data <- read.csv(\"/kaggle/input/supply-chain-dataset/supply_chain_data.csv\")\n",
    "\n",
    "# Calculate average shipping costs and revenue by carrier\n",
    "shipping_by_carrier <- data %>%\n",
    "  group_by(Shipping.carriers) %>%\n",
    "  summarize(Average_Shipping_Costs = mean(Shipping.costs, na.rm = TRUE),\n",
    "            Average_Revenue = mean(Revenue.generated, na.rm = TRUE))\n",
    "\n",
    "# Display the first few rows\n",
    "head(shipping_by_carrier)"
   ]
  },
