   "source": [
    "# Plot the average shipping costs and revenue by carrier\n",
    "#Average shipping costs by Carrier\n",
    "ggplot(shipping_by_carrier, aes(x = Shipping.carriers, y = Average_Shipping_Costs, fill = Shipping.carriers)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  geom_text(aes(label = round(Average_Revenue, 2)), vjust = -0.3, size = 3.5) +\n",
    "  labs(title = \"Average Shipping Costs by Carrier\", x = \"Shipping Carrier\", y = \"Average Shipping Costs\")"
   ]
