   "source": [
    "#Average revenue by carrier\n",
    "library(ggplot2)\n",
    "ggplot(shipping_by_carrier, aes(x = Shipping.carriers, y = Average_Revenue, fill = Shipping.carriers)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
