    "#Plot the average shipping costs by transportation mode\n",
    "ggplot(shipping_by_mode, aes(x = Transportation.modes, y = Average_Shipping_Costs, fill = Transportation.modes)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  geom_text(aes(label = round(Average_Revenue, 2)), vjust = -0.3, size = 3.5) +\n",
    "  labs(title = \"Average Shipping Costs by Transportation Mode\", x = \"Transportation Mode\", y = \"Average Shipping Costs\")"
   ]
