   "source": [
    "##### Recommendations for Cost Inefficiency:\n",
    "\n",
    "1. Switch to Carrier C for High-Revenue Orders: Since Carrier C has the highest average revenue, it might be beneficial to prioritize Carrier C for orders where revenue maximization is the goal. This is especially relevant if Carrier C’s service quality is superior or if it has faster delivery options that may enhance customer satisfaction.\n",
    "\n",
    "2. Limit Carrier A Usage for Low-Revenue Products: Given Carrier A’s relatively low revenue outcome, it may be wise to limit its use, especially for low-margin or low-revenue products. This can reduce costs without significantly impacting overall revenue.\n",
    "\n",
    "3. Optimize Carrier Selection Based on Order Profiles: If order characteristics (e.g., destination, product type) vary, tailor carrier selection accordingly. For example:\n",
    "\n",
    "   Use Carrier B for mid-revenue orders or shipments where a balance between cost and          revenue is essential.\n",
    "   Use Carrier C for high-priority, high-revenue shipments to maximize the return on    shipping expenses.\n",
    "\n",
    "4. Further Analyze Carrier Service Levels: If Carrier A or B have longer lead times or a higher defect rate that impacts customer satisfaction, consider these factors as additional criteria for choosing carriers, which could indirectly influence revenue."
   ]
