   "source": [
    "library(ggplot2)\n",
    "\n",
    "# Scatter plot to visualize relationship between stock levels and sales\n",
    "ggplot(stock_data, aes(x = Stock.levels, y = Number.of.products.sold)) +\n",
    "  geom_point() +\n",
    "  geom_smooth(method = \"lm\", se = FALSE, color = \"blue\") +\n",
    "  labs(title = \"Stock Levels vs. Number of Products Sold\", \n",
    "       x = \"Stock Levels\", y = \"Number of Products Sold\")"
   ]
  },
