   "source": [
    "# Group by Lead Time and calculate average stock levels and sales for each lead time group\n",
    "lead_time_analysis <- stock_data %>%\n",
    "  group_by(Lead.time) %>%\n",
    "  summarize(Average_Stock_Levels = mean(Stock.levels, na.rm = TRUE),\n",
    "            Average_Sales = mean(Number.of.products.sold, na.rm = TRUE))\n",
    "head(lead_time_analysis)"
   ]
