    "# Plot Average Stock Levels and Sales by Lead Time\n",
    "ggplot(lead_time_analysis, aes(x = Lead.time)) +\n",
    "  geom_line(aes(y = Average_Stock_Levels, color = \"Average Stock Levels\"), size = 1.2, linetype = \"solid\") +\n",
    "  geom_line(aes(y = Average_Sales, color = \"Average Sales\"), size = 1.2, linetype = \"dashed\") +\n",
    "  labs(\n",
    "    title = \"Impact of Lead Time on Stock Levels and Sales\",\n",
    "    x = \"Lead Time (Days)\",\n",
    "    y = \"Average Values\",\n",
    "    color = \"Metrics\"\n",
    "  \n",
    "  ) +\n",
    "  theme_minimal(base_size = 14) +\n",
    "  theme(\n",
    "    plot.title = element_text(hjust = 0.5, face = \"bold\", size = 16),\n",
    "    axis.title.x = element_text(face = \"bold\"),\n",
    "    axis.title.y = element_text(face = \"bold\"),\n",
    "    legend.position = \"top\",\n",
    "    legend.title = element_text(face = \"bold\"),\n",
    "    legend.text = element_text(size = 12)\n",
    "  ) +\n",
    "  scale_y_continuous(\n",
    "    limits = c(0, max(c(lead_time_analysis$Average_Stock_Levels, lead_time_analysis$Average_Sales)) + 50),\n",
    "    breaks = seq(0, max(c(lead_time_analysis$Average_Stock_Levels, lead_time_analysis$Average_Sales)) + 50, by = 100)\n",
    "  )"
   ]
