    "##### Key Observations\n",
    "\n",
    "1. Higher Sales with Shorter Lead Times (1–2 Days):\n",
    "Lead times of 1 and 2 days show relatively high average sales (590 and 400 units, respectively) with moderate stock levels (44.25 and 38).\n",
    "Shorter lead times appear to be correlated with higher sales, possibly due to faster replenishment that allows for better stock availability and customer satisfaction.\n",
    "\n",
    "2. Spike in Sales with Lead Time of 5 Days:\n",
    "Surprisingly, a lead time of 5 days shows the highest average sales (661.67 units) despite having similar average stock levels to other lead times.\n",
    "This could indicate a high-demand product type that customers are willing to wait longer for or a scenario where sales are driven by factors other than lead time, such as product uniqueness or pricing.\n",
    "\n",
    "3. Longer Lead Times (4 and 6 Days) with Lower Sales:\n",
    "Lead times of 4 and 6 days correspond to lower average sales (281.5 and 336 units) and relatively low stock levels.\n",
    "This suggests that products with longer lead times may experience lower sales, either due to delayed restocking or lower demand, indicating that optimizing these lead times could help balance inventory and potentially increase sales.\n",
    "\n",
    "##### Recommendations for Inventory Optimization\n",
    "\n",
    "1. Prioritize Faster Lead Times for High-Demand Products:\n",
    "For products with consistent high sales and shorter lead times, maintaining these lead times and stock levels appears beneficial. Efforts to further shorten lead times for these products could potentially boost sales even more, especially if faster shipping options or local suppliers are available.\n",
    "\n",
    "2. Adjust Stock Levels for Products with Longer Lead Times:\n",
    "For products with 4 and 6-day lead times and lower sales, it may be worth exploring ways to either reduce these lead times or adjust stock levels to avoid overstock. If lower demand is the reason, carrying lower inventory levels would reduce holding costs.\n",
    "\n",
    "3. Investigate Product-Specific Demand for 5-Day Lead Time:\n",
    "Since the 5-day lead time products show the highest sales, it’s possible these products have a unique demand pattern that makes customers willing to wait. A deeper analysis into these specific products could provide insights into how to capitalize on this demand—potentially adjusting lead time without negatively impacting sales.\n",
    "\n",
    "4. Consider a Demand Forecasting Model:\n",
    "With these insights, building a forecasting model that incorporates lead time, sales, and demand variability can optimize stock levels across different lead times. This model could help predict inventory needs more accurately and align restocking with expected demand, minimizing both stockouts and overstock."
   ]
