    "### Supply Chain Risk Management stage \n",
    "We'll focus on identifying and mitigating potential risks in the supply chain based on factors in the dataset. By analyzing metrics like defect rates, inspection results, lead times, and supplier locations, we can pinpoint vulnerabilities and areas for improvement. Here’s a structured approach to this stage.\n",
