    "##### Step 1: Data Preparation for Risk Analysis\n",
    "To begin, we’ll focus on key columns related to supply chain risk:\n",
    "\n",
    "Supplier name\n",
    "Location\n",
    "Lead time\n",
    "Defect rates\n",
    "Inspection results\n",
    "Transportation modes\n",
    "Routes\n"
