   "source": [
    "library(dplyr)\n",
    "data <- read.csv(\"/kaggle/input/supply-chain-dataset/supply_chain_data.csv\")\n",
    "# Select relevant columns for risk analysis\n",
    "risk_data <- data %>%\n",
    "  select(Supplier.name, Location, Lead.time, Defect.rates, Inspection.results, Transportation.modes, Routes)\n",
    "\n",
    "# Check for missing values and handle them if necessary\n",
    "sum(is.na(risk_data$Defect.rates))\n",
    "sum(is.na(risk_data$Inspection.results))\n",
    "\n",
    "head(risk_data)"
   ]
  },
