   "source": [
    "# Group data by supplier and location to calculate average defect rates\n",
    "defect_analysis <- risk_data %>%\n",
    "  group_by(Supplier.name, Location) %>%\n",
    "  summarize(Average_Defect_Rate = mean(Defect.rates, na.rm = TRUE)) %>%\n",
    "  arrange(desc(Average_Defect_Rate))\n",
    "\n",
    "# Display results for suppliers/locations with highest defect rates\n",
    "head(defect_analysis,10)"
   ]
