   "source": [
    "##### Key Observations\n",
    "\n",
    "High Defect Rates in Delhi and Chennai:\n",
    "Delhi and Chennai consistently show high defect rates across multiple suppliers, which indicates potential quality control challenges or process variability in these regions.\n",
    "\n",
    "Supplier-Specific Quality Variability:\n",
    "Suppliers 2, 3, 4, and 5 show varying defect rates across different locations. Suppliers with consistently high defect rates (e.g., Supplier 2 in Delhi) may need closer monitoring or stricter quality control measures.\n",
    "\n",
    "##### Recommendations:\n",
    "\n",
    "Implement Targeted Quality Improvement Programs:\n",
    "For high-defect regions like Delhi and Chennai, consider increasing inspection frequency or introducing quality control initiatives with these suppliers to reduce defect rates.\n",
    "\n",
    "Supplier Diversification:\n",
    "Explore alternative suppliers in lower-defect regions for products currently sourced from high-defect areas to diversify risk.\n",
    "\n",
    "Supplier Contract Adjustments:\n",
    "Negotiate defect rate targets with suppliers, with penalties for exceeding thresholds and rewards for meeting quality standards."
   ]
  },
