   "source": [
    "# Visualization to see inspection outcomes across transportation modes\n",
    "library(ggplot2)\n",
    "\n",
    "ggplot(inspection_analysis, aes(x = Transportation.modes, y = Count, fill = Inspection.results)) +\n",
    "  geom_bar(stat = \"identity\", position = position_dodge(width = 0.8), width = 0.7) +\n",
    "  geom_text(\n",
    "    aes(label = Count),\n",
    "    position = position_dodge(width = 0.8),\n",
    "    vjust = -0.5,\n",
    "    size = 4\n",
    "  ) +\n",
    "  labs(\n",
    "    title = \"Inspection Results by Transportation Mode\",\n",
    "    x = \"Transportation Mode\",\n",
    "    y = \"Count of Inspections\",\n",
    "    fill = \"Inspection Results\"\n",
    "  ) +\n",
    "\n",
    "  theme_minimal(base_size = 14) +\n",
    "  theme(\n",
    "    plot.title = element_text(hjust = 0.5, face = \"bold\", size = 16),\n",
    "    axis.title.x = element_text(face = \"bold\"),\n",
    "    axis.title.y = element_text(face = \"bold\"),\n",
    "    legend.position = \"top\",\n",
    "    legend.title = element_text(face = \"bold\"),\n",
    "    legend.text = element_text(size = 12)\n",
    "  ) +\n",
    "  scale_y_continuous(expand = expansion(mult = c(0, 0.1)))"
   ]
