   "source": [
    "# Calculate average lead times and defect rates by transportation mode and route\n",
    "transport_risk_analysis <- risk_data %>%\n",
    "  group_by(Transportation.modes, Routes) %>%\n",
    "  summarize(Average_Lead_Time = mean(Lead.time, na.rm = TRUE),\n",
    "            Average_Defect_Rate = mean(Defect.rates, na.rm = TRUE)) %>%\n",
    "  arrange(desc(Average_Lead_Time),desc(Average_Defect_Rate))\n",
    "\n",
    "# Display results\n",
    "head(transport_risk_analysis, 10)"
   ]
