    "##### Key Observations\n",
    "\n",
    "Long Lead Times on Rail and Air Routes:\n",
    "Rail (Route C) and air (Route B) routes show long average lead times, which could delay order fulfillment.\n",
    "\n",
    "High Defect Rates in Sea and Rail Routes:\n",
    "Routes like Sea Route B and Rail Route C show high defect rates, suggesting quality concerns on these routes. These might be linked to handling conditions or extended transit times.\n",
    "\n",
    "##### Recommendations\n",
    "Evaluate Alternative Routes:\n",
    "For critical shipments, consider alternative routes with shorter lead times and lower defect rates to ensure timely delivery.\n",
    "\n",
    "Use Higher-Reliability Modes for High-Quality Goods:\n",
    "Where possible, prioritize air or road routes with lower defect rates for high-value or sensitive goods to maintain quality.\n",
    "\n",
    "Implement Route-Specific Quality Checks:\n",
    "For higher-risk routes, implement additional quality checks on departure and arrival to minimize defects and manage quality more effectively."
   ]
