    "##### Summary of Supply Chain Risk Management Recommendations\n",
    "\n",
    "Supplier Quality Management: Focus on quality improvements in high-defect regions (Delhi and Chennai) and diversify suppliers as needed.\n",
    "\n",
    "Inspection Efficiency: Address inspection delays and improve protocols for rail and air transportation modes.\n",
    "\n",
    "Route Optimization: Select lower-risk routes for critical shipments, and conduct additional checks for high-defect routes."
